import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Nav from "./Components/Nav"
import Main from './Components/Main'

function App() {
  return (
    <>
    <Router>
      <Routes>
        <Route path='/' element={<Nav/>}>
          <Route path='/' element={<Main/>} />
        </Route>
      </Routes>
    </Router>
    </>
  );
}

export default App;
